import React from "react";
import Button from 'react-bootstrap/Button';

function Home() {

  return (
    <>
    <div className="d-grid gap-2">
      <Button variant="primary" size="lg">
        Locations
      </Button>
      <Button variant="secondary" size="lg">
        All Venues
      </Button>
    </div>
    <Button variant="primary" href="http://localhost:3000/locations">Locations</Button>
    <Button variant="primary" href="http://localhost:3000/venues">Venues</Button> 
    <Button variant="primary">Primary</Button>{' '}
    </>
  );
}

export default Home;
